						["customDuration"] = "function()\n    local this = WeakAuras.regions[aura_env.id].region\n    local thisSpell = GetSpellInfo(85256)\n    local s,d = GetSpellCooldown(thisSpell)\n    local _,gcd = GetSpellCooldown(61304)\n    local isCastable,isLowPower = IsUsableSpell(thisSpell)\n    local hpTotal = UnitPower(\"player\",9)\n    local isJudge = WA_GetUnitDebuff(\"target\",GetSpellInfo(20271),\"player\")\n    local isEmp = WA_GetUnitBuff(\"player\",GetSpellInfo(326732))\n    local isDP = WA_GetUnitBuff(\"player\",GetSpellInfo(223817))\n    \n    if gcd == 0 then\n        gcd = 1.5 / (1 + (UnitSpellHaste(\"player\") / 100))\n        gcd = math.floor(gcd*1000)/1000\n        gcd = math.max(gcd,0.75)\n    end\n    \n    if (IsSpellInRange(thisSpell,\"target\") == 1) then\n        if (d > gcd or isLowPower or not isCastable) and not isEmp then\n            this.icon:SetVertexColor(0.42,0.3,0.75,1)\n            this.icon:SetDesaturated(true)\n            this:SetGlow(false)\n        else\n            this.icon:SetVertexColor(1,1,1,1)\n            this.icon:SetDesaturated(false)\n            if hpTotal >= 5 or isJudge or isEmp or isDP then\n                this:SetGlow(true)\n            else \n                this:SetGlow(false)\n            end\n        end \n    else \n        this.icon:SetVertexColor(0.65,0.22,0.30,1)\n        this.icon:SetDesaturated(true)\n        this:SetGlow(false)\n    end\n    \n    return d, s + d\nend\n\n--WeakAuras.ShowOverlayGlow(frame, aura_env.config.glowCol)",
